"DT_output_2" AS 
 (SELECT
   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."P_0" AS "P_0", t2."P_1" AS "P_1", t2."P_2" AS "P_2", t2."P_3" AS "P_3", t2."P_4" AS "P_4", t2."P_5" AS "P_5", t2."P_6" AS "P_6", t2."P_7" AS "P_7", t2."P_8" AS "P_8", t2."P_9" AS "P_9", 
   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_2" AS t1
   LEFT OUTER JOIN
   "DT_node_data_2" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_3" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_7", t1."Leaf_9", t1."Leaf_10", t1."Leaf_11", t1."Leaf_15", t1."Leaf_18", t1."Leaf_19", t1."Leaf_27", t1."Leaf_28", t1."Leaf_29", t1."Leaf_30", t1."Leaf_33", t1."Leaf_35", t1."Leaf_37", t1."Leaf_38", t1."Leaf_39", t1."Leaf_40", t1."Leaf_42", t1."Leaf_43", t1."Leaf_45", t1."Leaf_46", t1."Leaf_48", t1."Leaf_49", t1."Leaf_50", t1."Leaf_51", t1."Leaf_52", t1."Leaf_53", t1."Leaf_54" ) AS node_id
  FROM
    model_input t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_30" > 1.500000) AND (t."X_34" > 7.500000) AND (t."X_37" > 13.500000) AND (t."X_33" <= 4.500000)) THEN 7 ELSE NULL END AS Leaf_7,
      CASE WHEN((t."X_30" > 1.500000) AND (t."X_34" > 7.500000) AND (t."X_37" > 13.500000) AND (t."X_33" > 4.500000) AND (t."X_3" <= 8.500000)) THEN 9 ELSE NULL END AS Leaf_9,
      CASE WHEN((t."X_30" > 1.500000) AND (t."X_34" > 7.500000) AND (t."X_37" > 13.500000) AND (t."X_33" > 4.500000) AND (t."X_3" > 8.500000)) THEN 10 ELSE NULL END AS Leaf_10,
      CASE WHEN((t."X_30" > 1.500000) AND (t."X_34" <= 7.500000) AND (t."X_37" <= 8.500000)) THEN 11 ELSE NULL END AS Leaf_11,
      CASE WHEN((t."X_30" <= 1.500000) AND (t."X_59" <= 6.500000) AND (t."X_5" <= 3.500000)) THEN 15 ELSE NULL END AS Leaf_15,
      CASE WHEN((t."X_30" <= 1.500000) AND (t."X_59" <= 6.500000) AND (t."X_5" > 3.500000) AND (t."X_38" > 1.500000)) THEN 18 ELSE NULL END AS Leaf_18,
      CASE WHEN((t."X_30" <= 1.500000) AND (t."X_59" <= 6.500000) AND (t."X_5" > 3.500000) AND (t."X_38" <= 1.500000) AND (t."X_37" <= 5.000000)) THEN 19 ELSE NULL END AS Leaf_19,
      CASE WHEN((t."X_30" <= 1.500000) AND (t."X_59" > 6.500000) AND (t."X_20" <= 6.500000) AND (t."X_5" > 4.500000) AND (t."X_22" <= 0.500000) AND (t."X_58" <= 3.500000)) THEN 27 ELSE NULL END AS Leaf_27,
      CASE WHEN((t."X_30" <= 1.500000) AND (t."X_59" > 6.500000) AND (t."X_20" <= 6.500000) AND (t."X_5" > 4.500000) AND (t."X_22" <= 0.500000) AND (t."X_58" > 3.500000)) THEN 28 ELSE NULL END AS Leaf_28,
      CASE WHEN((t."X_30" <= 1.500000) AND (t."X_59" > 6.500000) AND (t."X_20" <= 6.500000) AND (t."X_5" > 4.500000) AND (t."X_22" > 0.500000) AND (t."X_6" <= 3.500000)) THEN 29 ELSE NULL END AS Leaf_29,
      CASE WHEN((t."X_30" <= 1.500000) AND (t."X_59" > 6.500000) AND (t."X_20" <= 6.500000) AND (t."X_5" > 4.500000) AND (t."X_22" > 0.500000) AND (t."X_6" > 3.500000)) THEN 30 ELSE NULL END AS Leaf_30,
      CASE WHEN((t."X_30" <= 1.500000) AND (t."X_59" > 6.500000) AND (t."X_20" > 6.500000) AND (t."X_37" > 9.500000) AND (t."X_58" <= 5.500000)) THEN 33 ELSE NULL END AS Leaf_33,
      CASE WHEN((t."X_30" <= 1.500000) AND (t."X_59" > 6.500000) AND (t."X_20" > 6.500000) AND (t."X_37" <= 9.500000) AND (t."X_20" <= 10.500000)) THEN 35 ELSE NULL END AS Leaf_35,
      CASE WHEN((t."X_30" <= 1.500000) AND (t."X_59" > 6.500000) AND (t."X_20" > 6.500000) AND (t."X_37" <= 9.500000) AND (t."X_20" > 10.500000) AND (t."X_58" <= 2.000000)) THEN 37 ELSE NULL END AS Leaf_37,
      CASE WHEN((t."X_30" <= 1.500000) AND (t."X_59" > 6.500000) AND (t."X_20" > 6.500000) AND (t."X_37" <= 9.500000) AND (t."X_20" > 10.500000) AND (t."X_58" > 2.000000)) THEN 38 ELSE NULL END AS Leaf_38,
      CASE WHEN((t."X_30" <= 1.500000) AND (t."X_59" > 6.500000) AND (t."X_20" > 6.500000) AND (t."X_37" > 9.500000) AND (t."X_58" > 5.500000) AND (t."X_12" <= 10.500000)) THEN 39 ELSE NULL END AS Leaf_39,
