    model_input t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_62" > 0.500000) AND (t."X_46" <= 5.500000) AND (t."X_45" <= 2.500000)) THEN 5 ELSE NULL END AS Leaf_5,
      CASE WHEN((t."X_62" > 0.500000) AND (t."X_46" > 5.500000) AND (t."X_58" > 2.500000) AND (t."X_45" > 13.500000)) THEN 12 ELSE NULL END AS Leaf_12,
