      CASE WHEN((t."X_62" > 0.500000) AND (t."X_46" > 5.500000) AND (t."X_58" > 2.500000) AND (t."X_45" <= 13.500000) AND (t."X_42" > 10.000000)) THEN 14 ELSE NULL END AS Leaf_14,
      CASE WHEN((t."X_62" > 0.500000) AND (t."X_46" <= 5.500000) AND (t."X_45" > 2.500000) AND (t."X_59" > 9.500000) AND (t."X_58" <= 4.000000)) THEN 15 ELSE NULL END AS Leaf_15,
