      CASE WHEN((t."X_62" <= 0.500000) AND (t."X_18" <= 11.500000) AND (t."X_2" > 0.500000) AND (t."X_45" <= 12.500000) AND (t."X_53" > 2.000000)) THEN 24 ELSE NULL END AS Leaf_24,
