      CASE WHEN((t."X_62" > 0.500000) AND (t."X_46" > 5.500000) AND (t."X_58" <= 2.500000) AND (t."X_51" > 14.500000)) THEN 50 ELSE NULL END AS Leaf_50,
      CASE WHEN((t."X_62" > 0.500000) AND (t."X_46" <= 5.500000) AND (t."X_45" > 2.500000) AND (t."X_59" <= 9.500000) AND (t."X_51" <= 9.000000)) THEN 51 ELSE NULL END AS Leaf_51,
      CASE WHEN((t."X_62" > 0.500000) AND (t."X_46" <= 5.500000) AND (t."X_45" > 2.500000) AND (t."X_59" <= 9.500000) AND (t."X_51" > 9.000000)) THEN 52 ELSE NULL END AS Leaf_52,
      CASE WHEN((t."X_62" <= 0.500000) AND (t."X_18" > 11.500000) AND (t."X_58" > 9.500000) AND (t."X_1" <= 0.500000)) THEN 53 ELSE NULL END AS Leaf_53,
